import React from 'react';
import { Chrono } from 'react-chrono';
import { AiFillGithub, AiFillInstagram } from 'react-icons/ai';
import {
  TimelineContainer,
  ResponsiveContainer,
  HeaderContainer,
  Heading,
  CCBPHeading,
  TimelineCard,
  CardTitle,
  CardDate,
  CardContent,
  TagsContainer,
  Tag,
  LinkButton,
  IconContainer,
  PhotoCard,
  PhotoContainer,
  PhotoDescription,
  PhotoOverlay,
} from './styledComponents';

const TimelineView = ({ timelineItemsList }) => {
  const renderTimelineCard = item => {
    const showPhotoCard = new Date(item.title).getFullYear() >= 2016;

    return (
      <TimelineCard>
        <CardDate>{item.title}</CardDate>
        <CardTitle>
          {item.categoryId === 'PROJECT' ? item.projectTitle : item.courseTitle}
        </CardTitle>

        {showPhotoCard && (
          <PhotoCard>
            <PhotoContainer>
              <img 
                src={item.imageUrl || "/api/placeholder/400/200"} 
                alt={item.projectTitle || item.courseTitle} 
              />
              <PhotoOverlay>
                <PhotoDescription>
                  {item.categoryId === 'PROJECT' ? 'Project' : 'Activity'} Photo
                </PhotoDescription>
              </PhotoOverlay>
            </PhotoContainer>
          </PhotoCard>
        )}

        <CardContent>{item.description}</CardContent>
        {item.tagsList && (
          <TagsContainer>
            {item.tagsList.map(tag => (
              <Tag key={tag.id}>{tag.name}</Tag>
            ))}
          </TagsContainer>
        )}
        {item.projectUrl && (
          <LinkButton
            href={item.projectUrl}
            target="_blank"
            rel="noopener noreferrer"
          >
            <IconContainer>
              {item.projectUrl.includes('instagram.com') ? (
                <AiFillInstagram />
              ) : (
                <AiFillGithub />
              )}
            </IconContainer>
            View Project
          </LinkButton>
        )}
      </TimelineCard>
    );
  };

  return (
    <TimelineContainer>
      <ResponsiveContainer>
        <HeaderContainer>
          <Heading>
            MY JOURNEY OF
            <CCBPHeading>Interests & Activities</CCBPHeading>
          </Heading>
        </HeaderContainer>
        <Chrono
          theme={{
            primary: '#8855ff',
            secondary: '#ffffff',
            cardBgColor: '#ffffff',
            cardForeColor: '#171f46',
            titleColor: '#2b237c',
            titleColorActive: '#8855ff',
          }}
          items={timelineItemsList}
          mode="VERTICAL_ALTERNATING"
          cardHeight={300} // Increased to accommodate photos
          scrollable={{ scrollbar: true }}
          enableOutline
        >
          {timelineItemsList.map(item => renderTimelineCard(item))}
        </Chrono>
      </ResponsiveContainer>
    </TimelineContainer>
  );
};

export default TimelineView;
